import React, { Component } from 'react';

class doggyDaycare extends Component {
    render() {
        return (
            <div>
                <h1>Doggy Daycare</h1>
                <p>
                    We pride in our Doggy Daycare program at Zinky's. We hate to think of a pup sitting at home all day when tey could be at Zinky's playing with their dog friends and getting some much needed exercise! We know people lead very busy lives, let us walk your pup and give him/her attention while you're off to work making money for all those treats you have to buy them!
                </p>
            </div>
        );
    }
}

export default doggyDaycare;
